ビットカード、Pay Later などの即時資金調達手段を使用することが要求されます。','If you have not taken measures yet, please take measures for WooCommerce dedicated site monitoring starting from 2,200 yen per month.'=>'まだ対策をされていない方は月額2,200円からの WooCommerce 専用サイト監視の対策を','If you like <strong>Japanized for WooCommerce</strong> please leave us a %s&#9733;&#9733;&#9733;&#9733;&#9733;%s rating. A huge thanks in advance!'=>'もし、<strong>Japanized for WooCommerce</strong> を気に入って頂けたら%s&#9733;&#9733;&#9733;&#9733;&#9733;%s 評価してもらえたら、とても嬉しいです。','If you need professional support, please consider about <a href="%1$s" target="_blank" title="Site Construction Support service">Site Construction Support service</a> or <a href="%2$s" target="_blank" title="Maintenance Support service">Maintenance Support service</a>.'=>'専門的なサポートが必要な場合は、<a href="%1$s" target="_blank" title="Site Construction Support service">サイト構築支援サービス</a>や<a href="%2$s" target="_blank" title="Maintenance Support service">保守サポート サービス</a>についてご検討ください。','If you use it a bit for testing, you do not need to enter it here. But if you want to use Automatic zip code entry, you must get and input %s here. Please get it from <a href="https://e.developer.yahoo.co.jp/dashboard/" target="_blank">here</a>.'=>'テストに少し使用する場合は、ここに入力する必要はありません。 ただし、自動郵便番号入力を使用する場合は、ここで%sを取得して入力する必要があります。 <a href="https://e.developer.yahoo.co.jp/dashboard/" target="_blank">こちらから入手</a>してください。','If you use your PayPal account with more than one installation, please use a distinct prefix to separate those installations. Please use only English letters and "-", "_" characters.'=>'複数のインストールで PayPal アカウントを使用する場合は、それらのインストールを区別するために個別の接頭辞を使用してください。英字と"-", "_"文字のみを使用してください。','In order to use PayPal or Advanced Card Processing, you need to enable the Gateway.'=>'PayPal や Advanced Card Processing を利用するためには、ゲートウェイを有効にする必要があります。','In the payment completion process, the amount and ID did not match. Check on the Paidy admin.'=>'支払完了プロセスでは、金額と ID が一致しませんでした。 Paidy 管理画面で確認してください。','In the payment completion