hat can be displayed in the checkout application header. If no value is specified, the Paidy logo will be displayed.'=>'チェックアウトアプリケーションヘッダーに表示できるカスタムロゴの URL。値が指定されていない場合は、 Paidy ロゴが表示されます。','Usage tracking'=>'使用状況の追跡','Use this image'=>'この画像を使用','Use WC checkout form data (do not show any address fields)'=>'WC の購入フォームデータを使用する（住所欄は表示しない）','Used PayPal Checkout plugin'=>'PayPal Checkout プラグインを使用','Using %2$s%1$s%3$s PayPal.'=>'%2$s%1$s%3$s PayPalを使用する','Using the WC form data increases convenience for the customers, but can cause issues if card details do not match the billing data in the checkout form.'=>'WC フォームのデータを使用することで、お客様の利便性は向上しますが、カード情報が購入フォームの請求データと一致しない場合、問題が発生する可能性があります。','Vault enabled'=>'Vault 対応','Vaulting'=>'Vaulting','Vertical'=>'垂直','View logs'=>'ログの表示','Virtual order Setting'=>'バーチャル商品注文時の設定','Visit your online account. In your Account Overview, accept and deny this payment.'=>'オンラインアカウントにアクセスします。アカウント概要で、この支払いに同意するか否かを選択します。','Void authorization & fail the order/subscription'=>'オーサリングを無効にし、注文/定期購入を失敗させる。','Waiting for the webhook to arrive...'=>'Webhook の到着を待っているところ...。','Wakayama'=>'和歌山県','WC order for PayPal order %s not found.'=>'PayPal 注文%sの W C注文が見つかりませんでした。','We could not complete the onboarding process. Some features, such as card processing, will not be available. To fix this, please try again.'=>'オンボーディングプロセスを完了することができませんでした。カード処理など、一部の機能が利用できません。これを修正するために、もう一度お試しください。','We could not properly connect to PayPal. Try reloading the page.'=>'PayPal に正しく接続できませんでした。ページを再読み込みしてみてください。','We have finished processing your order.'=>'ご注文の処理が完了しました。','We will not accept returns or exchanges other than mistakes at the time of delivery on our company side.'=>'弊社側では配送時の間違い以外の返品や交換はお受けできません。','Webhook has been handled by %s'=>'Webhookは%sで処理されました','Webhook simulation'=>'Webhook シミュレーション','Webhook Status'=>'Webhook ステータス','Webhook status'=>'Webhook の状態','Wed'=>'水','Wednesday'=>'水','What logo the text message contains. Only applicable, when the layout style Text is used.'=>'テキストメッセージに含まれるロゴを指定します。レイアウトスタイルが「テキスト」の場合のみ適用されます。','When enabled, %1$sPayPal Pay Later messaging%2$s is displayed for eligible customers.%3$sCustomers automatically see the most relevant Pay Later offering.'=>'有効化すると、対象のお客様に対して %1$sPayPal Pay Later メッセージ%2$sが表示されます%3$sお客様には、最も関連性の高い Pay Later オファーが自動的に表示されます。','When enabled, a %1$sPay Later button%2$s is displayed for eligible customers.%3$sPayPal buttons must be enabled to display the Pay Later button.'=>'有効にすると、対象となる顧客に対して%1$s [後払い] %2$sボタンが表示されます。%3$sPayLater ボタンを表示するには、PayPal ボタンが有効であることが必要です（2）。','Where is the study group of Woocommerce in Japan?'=>'日本に WooCommerce の勉強会はありますか ?','Whether Advanced Card Processing is available in country or not.'=>'アドバンスト・カード・プロセッシングが国内で利用可能かどうか。','Whether logging of plugin events and errors is enabled.'=>'プラグインのイベントやエラーのロギングを有効にするかどうか。','Whether Pay Later is available in country or not.'=>'Pay Later が国内で利用可能かどうか。','Whether PayPal account is correctly configured or not.'=>'PayPal アカウントが正しく設定されているかどうか。','Whether PayPal supports the default store currency or not.'=>'PayPal がデフォルトの店舗通貨をサポートしているかどうか。','Whether Reference Transactions are enabled for the connected account'=>'接続されたアカウントでリファレンス・トランザクションが有効かどうか','Whether the PayPal Checkout Gateway plugin was configured previously or not'=>'PayPal Checkout Gateway プラグインが以前に設定されていたかどうか','Whether tracking is enabled on PayPal account or not.'=>'PayPal アカウントでトラッキングが有効になっているかどうか。','Whether vaulting is enabled on PayPal account or not.'=>'PayPal アカウントで Vaulting が有効になっているかどうか。','Whether we received webhooks successfully.'=>'Webhook を正常に受信できたかどうか。','White'=>'白','White no border'=>'ホワイトボーダーなし','WooCommerce currency supported'=>'WooCommerce の通貨に対応','WooCommerce Doc in Japanese'=>'WooCommerce の日本語ドキュメント','WooCommerce PayPal Payments'=>'WooCommerce PayPal 決済','WooCommerce PayPal Payments requires PHP 7.1 or above.'=>'WooCommerce PayPal Payments は、PHP 7.1 以上が必要です。','WooCommerce PayPal Payments requires WooCommerce to be installed 