                            %1$sこちら%2$sをクリックしてください。','You have PayPal vaulting enabled, that\'s why Pay Later options are unavailable now. You cannot use both features at the same time.'=>'PayPal の Vaulting が有効になっているため、後払いのオプションが使用できない状態になっています。両方の機能を同時に使用することはできません。','You need to complete your onboarding, before you can use the Advanced Card Processing option.'=>'Advanced Card Processing オプションを使用する前に、オンボーディングを完了する必要があります。','Your account is connected to sandbox, no real charging takes place. To accept live payments, turn off sandbox mode and connect your live PayPal account.'=>'アカウントはサンドボックス（試験環境）に接続されており、実際の充電は行われません。本番環境の支払いを受け入れるには、サンドボックスモードをオフにして、実際の PayPal アカウントに接続してください。','Your order on %s has been partially refunded. There are more details below for your reference:'=>'%sでのご注文は一部返金されました。 参考までに、以下に詳細があります。','Your order on %s has been refunded. There are more details below for your reference:'=>'%sでのご注文は返金されました。 参考までに、以下に詳細があります。','Your settings have been saved.'=>'設定を保存しました。']];
